import React from "react";

function Introduction() {
  return (
    <div className="introduction">
      <h4>Introduction</h4>
      <p>
        Studied industrial engineering and work as a quality engineer for the
        first 3 years in my career but somehow end up in the web world.
      </p>
      <h5>Skills:</h5>
      <ul>
        <li>HTML</li>
        <li>CSS + Basic SASS</li>
        <li>Javascript</li>
        <li>ReactJS</li>
      </ul>
    </div>
  );
}

export default Introduction;
